<!DOCTYPE html>
<html>
    <head>
        <link rel="icon" href="https://cdn.codereactor.tk/codereactor/square.png" />
        <link rel="stylesheet" href="https://cdn.codereactor.tk/internal/css/index.css" />
        <meta content="noindex, nofollow" name="robots" />
        <meta content="Official Content Delivery Network from Code Reactor containing your files" name="description" />
        <title>CodeReactor - File Not Found</title>
        <script src="https://codereactor.tk/internal/script/mobile-utils.js"></script>
        <script>
            function onload() {
                if (isUserAgentMobile()) {
                    document.getElementById("main").classList.add("mobile");
                } else {
                    document.getElementById("main").classList.add("desktop");
                }
            }
        </script>
    </head>
    <body onload="onload()" id="main">
        <img id="logo" src="https://cdn.codereactor.tk/codereactor/horizontal.png" />
        <div id="content">
            <h1>404 Not Found</h1>
            <p>
                This link don't have a image or a archive, see the data structure in your <a href="https://github.com/CodeReactorInc/cdn.codereactor.tk">GitHub</a>.
            </p>
        </div>
    </body>
</html>
